import React, {useEffect, useState} from 'react';
import {Navbar, Nav, Container, Image} from 'react-bootstrap';
import ProjectsNav from "./ProjectsNav";
import { useSelector } from 'react-redux';
import { setIsLogged } from '../redux/actions';

const Navigation = ({setIsLogged}) => {
    const [isAdmin, setAdmin] = useState(true);
    const isLogged = useSelector(state => state.isLogged);

    const  handleLogout = () => {
        localStorage.setItem('isLogged', 'false');
        //setIsLogged(false);
    }

    return (
        <Navbar bg="dark" variant="dark">
            <Container>
                <Navbar.Brand>
                    <Nav.Link href="/"><Image src="logo.png" width="50" rounded/></Nav.Link>
                    ProjectUJ
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="navbar-dark-example"/>
                <Nav>
                    {isLogged && <ProjectsNav/>}
                    {isLogged && <Nav.Link href="/tasks">Tasks</Nav.Link>}
                    {isLogged && isAdmin && <Nav.Link href="/users">Users</Nav.Link>}
                    {isLogged && <Nav.Link onClick={handleLogout}>Logout</Nav.Link>}
                </Nav>
            </Container>
        </Navbar>
    );
};

export default Navigation;
